import './AddCategoryForm.css';
import {useRef} from 'react'

function AddCategoryForm(props) {

    const nameRef = useRef()
    const typeRef = useRef()

    function formSubmitHandler(e) {
        e.preventDefault();

        const category = {
            name: nameRef.current.value,
            category: typeRef.current.value
        }

        props.onAddCategory(category)
    }

    return (
      <form onSubmit={formSubmitHandler}>
      <label>Kategooria nimi:</label> <br/>
      <input type="text" placeholder="Nimi" required ref={nameRef} /><br/><br/>
      <label>Kategooria tüüp:</label><br/>
      <label>PREMIUM, DELUXE või BASIC</label><br/>
      <input type="text" placeholder="Tüüp" required ref={typeRef} /><br/>
      <button>Lisa Kategooria</button>
  </form>
    )
}

export default AddCategoryForm
